/**
 * File Description: This component is the date picker which enables user to select the date from calendar
 * Author(s): Sashank Pindiproli
 * Date of Creation: 03/02/2020
 */

import React from 'react';
import { ToggleButton, ButtonGroup } from 'react-bootstrap';
import styled from 'styled-components';

const DatePickerComponent = ({ radios, defaultVal, onClick }) => {
  return (
    <StyledButtonGroup toggle>
      {radios.map((radio, idx) => (
        <ToggleButton
          key={idx}
          className="toggle-btn__container"
          type="radio"
          variant={defaultVal === radio.value ? 'primary' : 'light'}
          name="radio"
          value={radio.value}
          checked={defaultVal === radio.value}
          onChange={(e) => onClick(e.currentTarget.value)}
        >
          {radio.name}
        </ToggleButton>
      ))}
    </StyledButtonGroup>
  );
};

export default DatePickerComponent;
